import './App.css';
import TopMenu from './layout/TopMenu';
import { Routes, Route, BrowserRouter } from "react-router-dom";
import Home from './components/pages/Home'


function App() {
  return (
    <div className="App">
        <BrowserRouter>
        <TopMenu></TopMenu>
          <Routes>
            <Route exact path="/" element={<Home/>}></Route>
          </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
